", 'comment_created': datetime.datetime(2021, 6, 16, 19, 47, 34, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 652999307, 'comment_body': "There's a new line after } else. I'm referring to this.", 'comment_created': datetime.datetime(2021, 6, 16, 19, 53, 41, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 653227600, 'comment_body': 'Will fix it right away. Forgot to ran document formatter before pushing! My bad...', 'comment_created': datetime.datetime(2021, 6, 17, 5, 4, 52, tzinfo=datetime.timezone.utc), 'commenter': 'theoway', 'type': 'User'}, {'comment_id': 680417053, 'comment_body': 'A common godot convention is to use p_ for parameter and r_ for reference (changes input). Please update.', 'comment_created': datetime.datetime(2021, 7, 31, 22, 26, 21, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 680417100, 'comment_body': 'When the pr is ready to be submitted, make tests or delete the commented code because they cause confusion.', 'comment_created': datetime.datetime(2021, 7, 31, 22, 27, 22, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 680417218, 'comment_body': 'Godot uses `snake_case`. You are using `gfrom` as your variable names. Please change style.', 'comment_created': datetime.datetime(2021, 7, 31, 22, 28, 7, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 680417289, 'comment_body': 'Coding style.

> //Now finding positions of nodes inside a block

> // Now finding positions of nodes inside a block.', 'comment_created': datetime.datetime(2021, 7, 31, 22, 28, 46, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 680417372, 'comment_body': 'We are able to use `for (const StringName &e : selected_nodes)` now I think. Need to check.', 'comment_created': datetime.datetime(2021, 7, 31, 22, 29, 37, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 680418283, 'comment_body': "It's completely fine to name local variables like that. It can even be `gf` or something.", 'comment_created': datetime.datetime(2021, 7, 31, 22, 40, 20, tzinfo=datetime.timezone.utc), 'commenter': 'YuriSizov', 'type': 'User'}, {'comment_id': 680491371, 'comment_body': "I just have to make a few more additions. After that, I'll change the variables all together", 'comment_created': datetime.datetime(2021, 8, 1, 10, 44, 54, tzinfo=datetime.timezone.utc), 'commenter': 'theoway', 'type': 'User'}, {'comment_id': 680491381, 'comment_body': 'Sure!', 'comment_created': datetime.datetime(2021, 8, 1, 10, 45, 5, tzinfo=datetime.timezone.utc), 'commenter': 'theoway', 'type': 'User'}, {'comment_id': 680491440, 'comment_body': "If it works, then I'll change it all the possible places. ", 'comment_created': datetime.datetime(2021, 8, 1, 10, 45, 41, tzinfo=datetime.timezone.utc), 'commenter': 'theoway', 'type': 'User'}, {'comment_id': 680491474, 'comment_body': "Oops! My bad. I'll add comments as per the guidelines", 'comment_created': datetime.datetime(2021, 8, 1, 10, 46, 6, tzinfo=datetime.timezone.utc), 'commenter': 'theoway', 'type': 'User'}, {'comment_id': 686267548, 'comment_body': 'Todo for future pr. initialize to nullptr.', 'comment_created': datetime.datetime(2021, 8, 10, 19, 37, 55, tzinfo=datetime.timezone.utc), 'commenter': 'fire', 'type': 'User'}, {'comment_id': 686269212, 'comment_body': 'We can collect fixes into a later pr to fix comments. Minor style correct.', 'comment_create